 agonists on components of dysglycaemia in individuals with type 2 diabetes mellitus . Metabolic consequences of glucagon-like peptide - 1 receptor agonists ( P0C6A0 RAs ) are the result of enhanced glucose-stimulated insulin secretion , inhibition of glucagon release , delayed gastric emptying and increased satiety . These attributes make P0C6A0 agonists a treatment option in type 2 diabetes mellitus ( T2DM ) . To optimise treatment choice , a detailed understanding of the effects of P0C6A0 RAs on glucose homeostasis in individuals with T2DM is necessary . Although the various P0C6A0 RAs share the same basic mechanisms of action , differences in pharmacokinetic / pharmacodynamic characteristics translate into differential effects on parameters of glycaemia . Head-to-head comparisons between long-acting non-prandial ( liraglutide once daily and exenatide once weekly ) and shorter-acting prandial ( exenatide twice daily and lixisenatide once daily prandial ) P0C6A0 RAs confirm their differential effects on fasting plasma glucose ( FPG ) and post-prandial glucose ( PPG ) .

 once daily and exenatide once weekly demonstrate greater reductions in FPG but lesser impacts on PPG excursions plasma than exenatide twice daily . Prandial P0C6A0 RAs have a profound effect on post-prandial glycaemia , mediated by delaying gastric emptying , which is not subject to the tachyphylaxis occurring due to the sustained elevated plasma P0C6A0 concentrations after treatment with long-acting P0C6A0 RAs . DB09265 once-daily prandial , in contrast to liraglutide , strongly suppresses post-prandial glucagon secretion , further contributing to the more pronounced PPG-lowering effect found with lixisenatide . Evidence suggests that the P0C6A0 RAs that predominantly target the prandial glucose excursions , such as exenatide twice daily and lixisenatide once-daily prandial , are therefore best used as combination therapy with basal insulin and will form an important new treatment option for individuals with T2DM .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Chronic rapamycin restores brain vascular integrity and function through NO synthase activation and improves memory in symptomatic mice modeling Alzheimer ' s disease . Vascular pathology is a major feature of Alzheimer ' s disease ( AD ) and other dementias . We recently showed that chronic administration of the target-of-rapamycin ( TOR ) inhibitor rapamycin , which extends lifespan and delays aging , halts the progression of AD-like disease in transgenic human ( h )

</mark>
 mice modeling AD when administered before disease onset . Here we demonstrate that chronic reduction of TOR activity by rapamycin treatment started after disease onset restored cerebral blood flow ( Q03701 ) and brain vascular density , reduced cerebral amyloid angiopathy and microhemorrhages , decreased amyloid burden , and improved cognitive function in symptomatic hAPP ( AD ) mice . Like acetylcholine ( ACh ) , a potent vasodilator , acute rapamycin treatment induced the phosphorylation of endothelial nitric oxide ( NO ) synthase (

 ) and NO release in brain endothelium . Administration of the NOS inhibitor L-NG - 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 methyl ester reversed vasodilation as well as the protective effects of rapamycin on Q03701 and vasculature integrity , indicating that rapamycin preserves vascular density and Q03701 in AD mouse brains through NOS activation . Taken together , our data suggest that chronic reduction of TOR activity by rapamycin blocked the progression of AD-like cognitive and histopathological deficits by preserving brain vascular integrity and function . Drugs that inhibit the TOR pathway may have promise as a therapy for AD and possibly for vascular dementias .</div>

 , which is involved in vitamin D3 metabolism .</div>

 suppresses osteoclastogenesis induced by

 and cancer cells through inhibition of inflammatory pathways : a new use for an old drug . BACKGROUND AND PURPOSE : Most patients with cancer die not because of the tumour in the primary site , but because it has spread to other sites . Common tumours , such as breast , multiple myeloma , and prostate tumours , frequently metastasize to the bone . To search for an inhibitor of cancer-induced bone loss , we investigated the effect of thiocolchicoside , a semi-synthetic colchicoside derived from the plant Gloriosa superba and clinically used as a muscle relaxant , on osteoclastogenesis induced by receptor activator of NF-B ligand (

 ) and tumour cells . EXPERIMENTAL APPROACH : We used RAW 264.7 ( murine macrophage ) cells , a well-established system for osteoclastogenesis , and evaluated the effect of thiocolchicoside on 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - induced NF-B signalling and osteoclastogenesis as well as on osteoclastogenesis induced by tumour cells . KEY RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 suppressed osteoclastogenesis induced by

 , and by breast cancer and multiple myeloma cells . Inhibition of the NF-B pathway was responsible for this effect since the colchicoside inhibited

 - induced NF-B activation , activation of IB kinase ( IKK ) and suppressed inhibitor of NF-B ( IB ) phosphorylation and degradation , an inhibitor of NF-B . Furthermore , an inhibitor of the IB kinase  or NF-B essential modulator , the regulatory component of the IKK complex , demonstrated that the NF-B signalling pathway is mandatory for osteoclastogenesis induced by

 and tumour cells via the NF-B signalling pathway . Thus , thiocolchicoside , a drug that has been used for almost half a century to treat muscle pain , may also be considered as a new treatment for bone loss .</div>

 / Q9UHB4 ) type DB01221 receptors stabley expressed in Chinese hamster ovary cells using heat shock promoters . PREGS enhanced the Ca ( 2 + ) influx through the GluR epsilon 2 / zeta 1 receptors in a dose-dependent manner . The EC ( 50 ) of PREGS for the GluR epsilon 2 / zeta 1 receptors was 8.6 microM . Other sulfated neurosteroids , DB05804 ( DHEAS ) , 17beta - estradiol sulfate and 3alpha - ol - 5beta - pregnan - 20 - one sulfate ( 3alpha5betaS ) , inhibited the positive modulatory effect of PREGS on the GluR epsilon 2 / zeta 1 DB01221 receptors .

 ( TS ) is an important enzyme catalysing the reductive methylation of 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 to dTMP that is further metabolized to dTTP for DNA synthesis . Loss of viability following TS inhibition occurs as a consequence of depleted dTTP pools and at least in some cell lines , accumulation of dUTP and subsequent misincorporation of uracil into DNA . The expansion in dUTP pools is largely determined by the expression of the pyrophosphatase , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P33316

</mark>
 . Our previous work has shown that following TS inhibition the ability to accumulate dUTP was associated with an earlier growth inhibitory effect . 3 human lung tumour cell lines and HT29 human colon tumour cells transfected with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 have been used to investigate the relationship between loss of viability following TS inhibition and dUTP accumulation . Cell cycle arrest typical of TS inhibition was an early event in all cell lines and occurred irrespective of the ability to accumulate dUTP or p53 function . However , a large expansion of dUTP pools was associated with mature DNA damage ( 4 h ) and an earlier loss of viability following TS inhibition compared to cells in which dUTP pools were not expanded . In A549 cells damage to mature DNA may have been exacerbated by significantly higher activity of the excision repair enzyme , uracil-DNA glycosylase . Consistent with results using different inhibitors of TS , transfection of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 into HT29 cells significantly reduced the cytotoxicity of a 24 h but not 48 h exposure to ZD9331 . Although loss of viability can be mediated through dTTP deprivation alone , the uracil misincorporation pathway resulted in an earlier commitment to cell death . The relevance of this latter pathway in the clinical response to TS inhibitors deserves further investigation .</div>

 is the key 1 - hydroxylase . Both 25OHD and 1,25 ( OH ) 2D are catabolized by

 . 1,25 ( OH ) 2D is the ligand for the vitamin D receptor (

 ) , a transcription factor , binding to sites in the DNA called vitamin D response elements ( VDREs ) . There are thousands of these binding sites regulating hundreds of genes in a cell-specific fashion .

 - regulated transcription is dependent on comodulators , the profile of which is also cell specific . Analogs of 1,25 ( OH ) 2D are being developed to target specific diseases with minimal side effects . This review will examine these different aspects of vitamin D metabolism , mechanism of action , and clinical application .</div>
